import React from 'react';

import styles from './Logo.module.css';
import classNames from '../../utils/classNames';

export const logoFi =
  'data:image/svg+xml;base64,';

export const logoFiDark =
  'data:image/svg+xml;base64,';

export const logoSv =
  'data:image/svg+xml;base64,';

export const logoSvDark =
  'data:image/svg+xml;base64,';

export const logoRu =
  'data:image/svg+xml;base64,';

export const logoRuDark =
  'data:image/svg+xml;base64,';

export type LogoSize = 'full' | 'small' | 'medium' | 'large';

export type LogoProps = {
  /**
   * Alt text to apply to the logo
   */
  alt?: string;
  /**
   * Additional class names to apply to the logo
   */
  className?: string;
  /**
   * Adds a data-testid attribute to the root element with the given value
   */
  dataTestId?: string;
  /**
   * The size of the logo
   * @default 'full'
   */
  size?: LogoSize;
  /**
   * Src of the logo. Data-url, locally imported image or a URL
   */
  src: HTMLImageElement['src'];
  /**
   * Title for the logo
   */
  title?: string;
  /**
   * Override or extend the styles applied to the component
   */
  style?: React.CSSProperties;
};

/* & React.ComponentPropsWithoutRef<'svg'>; */

export const Logo = ({ alt = '', className, dataTestId, size = 'full', style, src, ...rest }: LogoProps) => {
  const props = {
    src,
    size,
    className: classNames(styles.logo, size !== 'full' && styles[size], className),
    style,
    'data-testid': dataTestId,
    ...rest,
  };

  return <img alt={alt} {...props} />;
};
